import { Box, Button } from "@mui/material";
import { StrictMode } from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import ourChatsJson from "./darkneonshadows.json";

const rootElement = document.getElementById("root")!;
const reactRoot = ReactDOM.createRoot(rootElement);

const ourConversation: SnapchatChatConversation = ourChatsJson;

enum ChatType {
  MEDIA,
  CHAT,
}

interface SnapchatChat {
  sender: string;
  receiver: string;
  type: string;
  text: string;
  timestamp: string;
}

interface SnapchatChatConversation {
  users: String[];
  chats: SnapchatChat[];
}

function generateMessagesBox() {
  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "column",
        width: "100vw",
        height: "100vh",
        backgroundColor: '#252525'
      }}
    ></Box>
  );
}

reactRoot.render(
  <StrictMode>
    <BrowserRouter>{generateMessagesBox()}</BrowserRouter>
  </StrictMode>
);
